import React from "react";
import "./styles.css";

const Header = () => {
  return (
    <div>
      <div className="header">
        <div className="nav">
          <ul>
            <li>00 HOME</li>
            <li>01 DESTINATION</li>
            <li>02 CREW</li>
            <li>03 TECHNOLOGY</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Header;
